INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (1, 'Panadol 500mg tablets', 'Painkiller medication, designed to be used as an analgesic. May help in reducing fever.', 'Analgesic', '5.99');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (2, 'Codral PE Day & Night tablets', 'Ideal for headaches and fever, blocked/runny nose and body aches & pains. Contains 36 Day capsules and 12 Night capsules.', 'Painkiller', '17.99');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (3, 'Betadine Sore Throat Lozenges', 'Relieves sore throat discomfort, helps kill bacteria.', 'Antipyretic', '7.99');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (4, 'Vicks Action Cold and Flu', 'Vicks Action Cold & Flu Night Relief from 6 cold and flu symptoms: blocked noses, headaches, runny noses, sneezing, sore throat pain and fever.', 'Analgesic', '11.49');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (5, 'Bosistos Native Energy Oil', 'An invigorating blend of pure essential oils infused with hand-picked Australian native ingredients.', 'Analgesic', '7.99');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (6, 'Bisolvon Dry Cough Liquid', 'Bisolvon Dry Liquid is used to relieve a dry, irritating cough.', 'Antibiotic', '18.86');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (7, 'Nurofen Zavance 100 Liquid Capsules', 'For fast, effective headache relief choose Nurofen Zavance Liquid Capsules.', 'Antipyretic', '15.39');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (8, 'Rafen Tablets 100', 'For the temporary relief of pain where inflammation is present.', 'Analgesic', '22.80');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (9, 'Advil Liquid Capsules 90', 'Advil Liquid Capsules relieves pain fast.', 'Antiseptic', '3.99');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (10, 'Osteomol 665mg Tablets 96', 'Reduces pain due to arthritis.', 'Analgesic', '21.99');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (11, 'Goanna Heat Rub Cream 100g', 'This extra hot preparation is specially developed for the temporary relief of muscular aches and pains including arthritis, lumbago, rheumatism, back ache, fibrositis and bruises.', 'Painkiller', '5.99');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (12, 'Combantrin Chocolate Squares 24', 'Threadworms, hookworms and roundworms can be easily and effectively treated with Combantrin chocolate squares.', 'Stimulant', '35.99');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (13, 'Prospan Chesty Cough Childrens (Ivy Leaf) 200ml', 'When you need a trusted remedy that’s reliable and great tasting, turn to Prospan for Children – the clinically proven chesty cough medicine.', 'Cough syrup', '12.99');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (14, 'Nasonex Allergy Non-Drowsy 24 Hour Nasal Spray', 'Nasonex Allergy nasal spray is an effective treatment & prevention of hayfever, dust allergies, pet allergies & mould allergies.', 'Antiallergy', '46.99');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (15, 'Systane Ultra Preservative', 'Systane Ultra UD Lubricant Eye Drops have high performance, extended protection, fast symptom relief and preservative free vials.', 'Painkiller', '5.59');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (16, 'Nulax Natural Laxative Tablets', 'Nulax Natural Laxative Tablets are small diamond shaped, easy to swallow tablets.', 'Antibiotic', '12.89');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (17, 'De Gas 48 Capsules', 'De-Gas helps to relieve stomach wind, bloating and gas.', 'Antiseptic', '10.99');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (18, 'Nicotinell Mint Gum 2mg', 'Nicotinell Gum Mint 2mg is for smokers who smoke less than 20 cigarettes a day. Nicotinell Gum is a crispy coated, soft chewing gum with an unexpectedly bold taste that is pleasant to chew. Helps you stop smoking.', 'Antibiotic', '18.99');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (19, 'Gaviscon Dual Action Tablets', 'Neutralises excess stomach acid to relive discomfort.', 'Painkiller', '20.99');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (20, 'Vicks Baby Balsam Decongestant', 'Vicks Baby Balsam is a chest rub that soothes, moisturises and relaxes your baby.', 'Statin', '7.89');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (21, 'Metamucil Daily Fibre Supplement Fibre Caps', 'Metamucil Fibrecaps is a multi-health fibre supplement made with 100% natural psyllium. Take Metamucil daily. The natural way to stay regular and support a healthy gut.', 'Painkiller', '6.29');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (22, 'Osmolax 833g', 'Bisolvon Dry Liquid is used to relieve a dry, irritating cough.OsmoLax restores the bodys natural rhythm. It is virtually unabsorbed so it remains in the bowel and directs water into the stool. This lubricates and softens, as well as bulks the stool which stimulates the urge to go to the toilet.', 'Oral contraceptive', '10.59');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (23, 'Prunelax 200 Tablets', 'Natural, effective and predictable solution for constipation. To assists in the relief of constipation.', 'Painkiller', '15.49');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (24, 'Hylo Forte 2mg Eye Drops 10mL', 'The premium solution for longer lasting eye lubrication.', 'Antibiotic', '11.19');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (25, 'Gold Cross Castor Oil', 'Castor Oil may be taken internally for its laxative action, or used externally for its emollient effect on the skin.', 'Painkiller', '18.89');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (26, 'Ural 4g 28 Sachets', 'Ural is a pleasantly flavoured effervescent drink which provides relief from painful burning symptoms of urinary Tract Infections. ', 'Antipyretic', '20.59');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (27, 'Savlon Antiseptic Cream', 'Savlon Antiseptic Cream contains effective germ-killing and cleansing agents. Savlons smooth moisturising cream base allows gentle application onto damaged skin.', 'Antiseptic', '16.89');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (28, 'Mendeleev Ibuprofen 96 Tablets', 'Relief of pain and inflammation.', 'Painkiller', '15.19');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (29, 'Betadine Sore Throat Gargle', 'Anti-bacterial sore throat treatment.', 'Antiseptic', '10.79');
INSERT INTO `item` (`ItemID`, `ItemName`, `ItemDesc`, `ItemCategory`, `ItemPrice`) VALUES (30, 'Claratyne Childrens Hayfever & Allergy Relief', 'Claratyne Childrens chewable tablets provide rapid 24 hour, non-drowsy relief from Hayfever & allergy symptoms including sneezing, runny nose, watery itchy eyes and itchy rash.', 'Antiallergy', '18.99');
